import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Add an item to the cart to set up the test case
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();

    // Wait for the cart counter to update
    await page.waitForFunction(() => document.getElementById('cartCount')?.textContent.trim() === '1');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // 3. Find and click the remove button for the item
    const removeButton = page.locator('.remove-item');
    await removeButton.waitFor({ state: 'visible', timeout: 5000 });
    await removeButton.click();

    // 4. Verify the item is removed by checking for the empty cart message
    const emptyCartMessage = page.locator('.empty-cart');
    await emptyCartMessage.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    const extractedData = {
      emptyCartText: await emptyCartMessage.textContent()
    };

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
